As the root database user, let's create a new database for a regular, new user. The regular user will be granted all privileges on the new database, including all its tables. Other than granting all privileges , we could limit the user to specific privileges, including: CREATE, DROP, DELETE, INSERT, SELECT, UPDATE, and GRANT OPTION . Such privileges may be called operations or functions, and they allow MariaDB users to use and modify the databases, where appropriate. For example, we may want to limit the webapp user to only be able to use SELECT commands. It totally depends on the purpose of the database and our security risks. MariaDB [(none)]> create database linuxdb;
MariaDB [(none)]> grant all privileges on linuxdb.* to 'webapp'@'localhost';
MariaDB [(none)]> show databases; Exit out of the MariaDB database as the root MariaDB user , and then exit out of the root Linux user account , and you should be back to your normal Linux user account: MariaDB [(none)]> \q
root@hostname:~# exit Note: relational database keywords are often written in all capital letters. As far as I know, this is simply a convention to make the code more readable. However, in most cases I'll write the keywords in lower case letters. This is simply because, by convention, I'm super lazy.

226.body:
We can start doing MariaDB work. As a reminder, we've created a new MariaDB user named webapp and a new database for webapp that is called linuxdb . When we run the show databases command as the webapp user, we should see the linuxdb database (and only the linuxdb database). Note below that I use the -p option. This instructs MariaDB to request the password for the webapp user, which is required to log in. mariadb -u webapp -p
MariaDB [(none)]> show databases;
MariaDB [(none)]> use linuxdb; A database is not worth much without data. In the following code, I create and define a new table for our linuxdb database. The table will be called distributions , and it will contain data about various Linux distributions (name of distribution, distribution developer, and founding date). MariaDB [(linuxdb)]> create table distributions -> ( -> id int unsigned not null auto_increment, -> name varchar(150) not null, -> developer varchar(150) not null, -> founded date not null, -> primary key (id) -> );
Query OK, 0 rows affected (0.07 sec) MariaDB [(linuxdb)]> show tables;
MariaDB [(linuxdb)]> describe distributions; Congratulations! Now create some records for that table.

228.body:
We will complete the following tasks to refresh our MySQL/MariaDB knowledge: retrieve some records or parts of records, delete a record, alter the table structure so that it will hold more data, and add a record: MariaDB [(linuxdb)]> select name from distributions;
MariaDB [(linuxdb)]> select founded from distributions;
MariaDB [(linuxdb)]> select name, developer from distributions;
MariaDB [(linuxdb)]> select name from distributions where name='Debian';
MariaDB [(linuxdb)]> select developer from distributions where name='Ubuntu';
MariaDB [(linuxdb)]> select * from distributions;
MariaDB [(linuxdb)]> alter table distributions -> add packagemanager char(3) after name;
MariaDB [(linuxdb)]> describe distributions;
MariaDB [(linuxdb)]> update distributions set packagemanager='APT' where id='1';
MariaDB [(linuxdb)]> update distributions set packagemanager='APT' where id='2';
MariaDB [(linuxdb)]> update distributions set packagemanager='DNF' where id='3';
MariaDB [(linuxdb)]> select * from distributions;
MariaDB [(linuxdb)]> delete from distributions where name='Debian';
MariaDB [(linuxdb)]> insert into distributions -> (name, packagemanager, developer, founded) values -> ('Debian', 'The Debian Project', '1993-09-15'), -> ('CentOS', 'YUM', 'The CentOS Project', '2004-05-14');
MariaDB [(linuxdb)]> select * from distributions;
MariaDB [(linuxdb)]> select name, packagemanager -> from distributions -> where founded < '2004-01-01';
MariaDB [(linuxdb)]> select name from distributions order by founded;
MariaDB [(linuxdb)]> \q

