The WordPress documentation describes how to use phpMyAdmin to create the database and a user for WordPress. phpMyAdmin is a graphical front end to the MySQL/MariaDB relational database that you would access through the browser. I like to minimize the software that we install on servers to reduce the server's security exposure. Therefore, we are going to create the WordPress database and a database user using the same process we used to create a database and user for our login.php and distros.php pages. The general instructions are: Switch to the root Linux user Login as the MariaDB root user Specifically, we do the following on the command line: sudo su
mariadb -u root The mariadb -u root command places us in the MariaDB command prompt. The next general instructions are to: Create a new user for the WordPress database Be sure to replace the Xs with a strong password Create a new database for WordPress Grant all privileges to the new user for the new database Examine the output Exit the MariaDB prompt Specifically, this means the following (be sure to replaces the Xs with a unique and strong password of your own): create user 'wordpress'@'localhost' identified by 'XXXXXXXXX';
create database wordpress;
grant all privileges on wordpress.* to 'wordpress'@'localhost';
show databases;
\q

240.body:
When we created a file called login.php file that contained the name of the database (e.g. linuxdb), the name of the database user (e.g., webapp), and the user's password. we followed the same general process that WordPress follows. However, instead of login.php, WordPress uses a file called wp-config.php that we will have to edit. Follow these general steps: Change to the wordpress directory, if you haven't already. Copy and rename the wp-config-sample.php file to wp-config.php . Edit the file and add your WordPress database name, user name, and password in the fields for DB_NAME , DB_USER , and DB_PASSWORD . This means that we specifically do the following: cd /var/www/html/wordpress
sudo cp wp-config-sample.php wp-config.php
sudo nano wp-config.php In nano, add your database name, user, and password in the appropriate fields, just like we did with our login.php file. Additionally, we want to disable FTP uploads to the site. To do that, navigate to the end of the file and add the following line: define('FS_METHOD','direct');
